Kawan Buntel...

Ini adalah produk yang pas banget buat mendampingi makanan kita sehari-hari di rumah atau dimana aja, dan juga bisa sebagai cemilan sobat #netflix. 

Kerupuk Tenggiri @legitcrackers ini usaha produksi rumahan dari Andrew, yang sebelumnya adalah tugas kuliah di tahun 2017 untuk bikin sebuah usaha. Dengan modal pede dengan resep kerupuk tenggiri dari orangtuanya dan ternyata hasilnya tidak mengecewakan dalam soal rasa dan higienisnya, akhirnya bisnis ini diteruskan sampai sekarang.

Rasa kerupuknya sendiri ada Original, Cheese, Seaweed, Sweet Corn, Spicy, Savage, dan Black Legit. Rasa ikan tenggirinya berasa banget, gak amis, dan gurihnya nggak lebay. Tanpa bahan pengawet dan packaging-nya sangat rapat jadi bisa awet dan tetap crunchy dalam jangkan waktu yang lama. 

Layak dicobain nih Kawan Buntel, dijamin ketagihan, apalagi harganya bersahabat banget!!...jadi langsung follow dan order aja ke @legitcrackers ya..

